import React from 'react'
import AppBar from '@material-ui/core/AppBar';
import { IconButton, Toolbar, Typography, Button } from '@material-ui/core';
import "fontsource-poppins";

const Navbar = (props) => (
    <AppBar position="static" style={{ 'backgroundColor': "#393b44", 'fontFamily': "poppins" }}>
        <Toolbar>
            <CardMedia
                image="/static/images/cards/paella.jpg"
                title="Paella dish"
            />
            <Typography variant="h5" style={{ 'fontFamily': "poppins", "color": "#f1f3f8" }}>
                SyntaxMeets
            </Typography>
            <Button color="inherit" style={{ 'marginLeft': "auto", 'fontFamily': "poppins" }}>Login</Button>
        </Toolbar>
    </AppBar>
)

export default Navbar;
